import cl from "./CheckBox.module.css";

export const CheckBox = ({ value = "stock", round="" , name="", checked=true}) => {
  return (
    <div className="checkbox_container">
      <input name={name} type="checkbox" checked={checked} value={value} className={[cl.checkbox, cl[round]].join(" ")} />
      <label> {value} </label>
    </div>
  );
};
